function drawChart(n){var t;switch(n){case 0:t="F(t)";break;case 1:t="A(ω)";break;default:t="ϕ(ω)"}$("#error").addClass("hide");$.get("/Home/GetChartData",{a:$("#a").val(),k:$("#k").val(),type:$("input[name=type]:checked").val(),funcNumber:n},function(n){var i,r;if(!n.isValid){$("#error").toggle();$("#error")[0].textContent="You entered wrong data. All values must be doubles";$("#error").removeClass("hide");return}i=n.x.slice();i.unshift("x");r=n.y.slice();r.unshift(t);c3.generate({bindto:"#chart",data:{x:"x",columns:[i,r]}})})}